// HasStore applies the HasEdge predicate on the "store" edge.
func HasStore() predicate.StoreWithdraw {
	return predicate.StoreWithdraw(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, StoreTable, StoreColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasStoreWith applies the HasEdge predicate on the "store" edge with a given conditions (other predicates).
func HasStoreWith(preds ...predicate.Store) predicate.StoreWithdraw {
	return predicate.StoreWithdraw(func(s *sql.Selector) {
		step := newStoreStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.StoreWithdraw) predicate.StoreWithdraw {
	return predicate.StoreWithdraw(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.StoreWithdraw) predicate.StoreWithdraw {
	return predicate.StoreWithdraw(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.StoreWithdraw) predicate.StoreWithdraw {
	return predicate.StoreWithdraw(sql.NotPredicates(p))
}
